// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract NFT is ERC721, AccessControl {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    uint256 private _nextTokenId;

    constructor() ERC721("MyToken", "MTK") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
    }

    function grantRole(bytes32 role, address to ) public virtual override onlyRole(DEFAULT_ADMIN_ROLE) {
            _grantRole(role, to);
    }

    function safeMint(address to) public onlyRole(MINTER_ROLE) {
        uint256 tokenId = _nextTokenId++;
        _safeMint(to, tokenId);
    }

    // The following functions are overrides required by Solidity.

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

contracts/NFTMinter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IERC721 {
    function safeMint(address to) external;
}

contract NFTMinter is Ownable, Pausable, ReentrancyGuard {
    IERC721 public nft;

    mapping(address => uint) public balanceOf;

    constructor(IERC721 _nftContract) Ownable(msg.sender) {
        nft = _nftContract;
    }

    function whitelist(
        address[] calldata _account,
        uint[] calldata _quantity
    ) external onlyOwner {
        require(_account.length == _quantity.length, "Invalid array.");
        for (uint i = 0; i < _account.length; i++) {
            balanceOf[_account[i]] = _quantity[i];
        }
    }

    function updateNFT(IERC721 _nft) external onlyOwner {
        nft = _nft;
    }

    function mint(uint amount) external whenNotPaused nonReentrant {
        require(balanceOf[msg.sender] >= amount, "Nothing to mint.");

        balanceOf[msg.sender] -= amount;

        for (uint i = 0; i < amount; i++) {
            nft.safeMint(msg.sender);
        }
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

